import ReactDOM from 'react-dom'
import './index.css'
import Table from './Table'

const Index = () => {
  const memoData = [{ category: 'Things to buy', content: 'milk, egg' }, { category: 'Todo', content: 'hair cut' }]

  const memoData2 = {
    category: 'qwe',
    content: 'false',
  }

  const [memo, setMemo] = useState(memoData2)

  return (
    <div>
      <h1>CRUD app with React Hooks</h1>

      <h2>Add memo</h2>
      {/* <MyComponent value="3000" /> */}

      <h2>Memo table</h2>
      <Table category={memoData2.category} />
    </div>
  )
}

ReactDOM.render(<Index />, document.getElementById('root'))
